import React from 'react';
import styled from 'styled-components';

const WorkersDropdownContainer = styled.select`

`;

const WorkersDropdownOption = styled.option`

`;


const WorkersDropdown = props => {
    return (
        <WorkersDropdownContainer>
            <WorkersDropdownOption value="volvo">Volvo</WorkersDropdownOption>
            <WorkersDropdownOption value="saab">Saab</WorkersDropdownOption>
            <WorkersDropdownOption value="opel">Opel</WorkersDropdownOption>
            <WorkersDropdownOption value="audi">Audi</WorkersDropdownOption>
        </WorkersDropdownContainer>
    )
}

export default WorkersDropdown;
